import React from "react";
import ReactDOM  from "react-dom";
import "./index.css"
import Primeiro from "./componetes/Primeiro"
import Segundo from "./componetes/Segundo";
import terceiro from "./componetes/terceiro";
import Terceiro from "./componetes/terceiro";

ReactDOM.render(
    <div>
        <Terceiro>
            <ul>
                <li>Assimiu</li>
                <li>Penda</li>
            </ul>
        </Terceiro>
    </div>
    ,
    document.getElementById('root')
)
